INSERT INTO `job_listings` (`id`, `user_id`, `category_id`, `title`, `overview`, `description`, `status`, `views_count`, `applications_count`, `bookmarks_count`, `income`, `is_start_income`, `currency`, `approval`, `location`, `is_remote`, `is_urgent`, `type`, `last_contacted_at`, `created_at`, `updated_at`) VALUES
(1, 2, 9, 'DEVELOPER FOR USERVAULT', 'Requirements for a Web Developer\nStrong knowledge of HTML, CSS, and JavaScript', 'About Uservault\n\nUservault is a modern platform focused on secure user management, data protection, and scalable digital solutions. We help businesses manage users, authentication, and sensitive data efficiently and securely. To strengthen our development team, we are looking for a motivated and skilled Developer.\n\nYour Responsibilities\n\nDesign, develop, and maintain web applications and backend services\n\nWork on secure user authentication, authorization, and data handling features\n\nCollaborate with designers and product managers to implement new features\n\nWrite clean, efficient, and well-documented code\n\nOptimize performance, security, and scalability of the platform\n\nFix bugs and continuously improve existing systems\n\nYour Profile\n\nStrong knowledge of HTML, CSS, and JavaScript\n\nExperience with modern frameworks (e.g. React, Vue.js, Angular, or similar)\n\nBackend experience with Node.js, PHP, Python, or similar technologies\n\nExperience with databases (SQL or NoSQL)\n\nFamiliarity with APIs, RESTful services, and authentication systems\n\nKnowledge of Git and version control workflows\n\nUnderstanding of web security best practices is a plus\n\nGood communication skills in English\n\nWhat We Offer\n\nWork on a modern and secure platform\n\nFlexible working hours and remote options\n\nA collaborative and innovative team environment\n\nOpportunities for learning and professional growth\n\nCompetitive salary based on experience\n\nInterested?\n\nJoin Uservault and help us build secure and scalable digital solutions for the future.', 'active', 1, 0, 0, '250', 1, 'USD', 'pending', NULL, 1, 0, 'project', NULL, '2026-01-14 08:14:58', '2026-01-14 08:19:40');
