(92, 251, NULL, '', 'Period: Long Term â±ï¸\nBudget: Mid Tier ðŸ’¸ (condition dependent)\n\nInvestment:\nTec-9 | Whiteout (Factory New preferred)\n\nReason:\nThere are only ~2,000 Factory New Tec-9 | Whiteout in existence.\nSupply is extremely limited and will only shrink over time.\nOnce the collection gets discontinued or attention shifts back, scarcity becomes the main driver.\n\nStrategy:\nPrioritize Factory New if possible.\nThis is not a fast flip â€” itâ€™s a patience play.\nHold and let supply do the work over time.\n\nðŸ‘‰ Note:\nExtreme scarcity doesnâ€™t guarantee returns â€” but it strongly defines the upside.', 'active', 'image', 'en', 0, 0, 0, 0, 0, 28, 1, 0, 0, 0, 'data:image/webp;base64,', '2026-01-31 02:51:48', '2026-02-12 19:21:12', 0),
(93, 251, NULL, '', 'Period: Midâ€“Long Term â±ï¸\nBudget: Mid Tier ðŸ’¸ (~50$ total, scalable)\n\nInvestment:\nâ€¢ Prisma Case, Prisma 2 Case, Danger Zone Case\nâ€¢ Elemental Craft stickers (Armory)\nâ€¢ Budapest Team Sticker Capsules (no autographs, ~0.25$ on sale)\n\nReason:\nThe case market is currently quiet after the post-holiday cooldown.\nPrisma-related cases remain stable, which fits this phase.\nAt the same time, Budapest capsules entered the sale window and Armory ROI is near recent lows, creating early data and better entry conditions.\n\nStrategy:\nFocus on team capsules, skip autographs.\nTreat cases as slow accumulation plays.\nArmory items work best when bought during low-attention phases.\n\nðŸ‘‰ Note:\nSupply matters â€” but value only forms when demand eventually follows.', 'active', 'image', 'en', 0, 0, 0, 0, 0, 27, 0, 0, 0, 0, 'data:image/webp;base64,', '2026-01-31 16:48:45', '2026-02-12 19:21:12', 0),
(94, 251, NULL, '', 'Period: Long Term â±ï¸\nBudget: Lowâ€“Mid Tier ðŸ’¸ (cheap entry, condition dependent)\n\nInvestment:\nFAMAS | Halftone Watch (Graphic Design Collection)\n\nReason:\nThe Graphic Design Collection is already discontinued.\nSupply is fixed, but prices are still relatively low due to limited attention.\nFor cheap skins with capped supply, time is usually the main driver.\n\nStrategy:\nBuy and hold â€” no active management needed.\nThis is not about short-term movement.\nPatience matters more than timing the perfect entry.\n\nðŸ‘‰ Note:\nDiscontinued supply removes downside risk, but upside still depends on demand.', 'active', 'image', 'en', 0, 0, 0, 0, 0, 27, 0, 0, 0, 0, 'data:image/webp;base64,', '2026-01-31 18:11:19', '2026-02-12 19:21:12', 0),
